<script>
    import InfoBox from "./InfoBox";
    const valueToHSL = value => {
        const hue = 220 + Math.round((360 - 220) * value / 100);
        return `hsl(${hue}, 100%, 50%)`;
    };

    const getOffset = svg => {
        const rect = svg.getBoundingClientRect();
        return {
            top: rect.top + window.scrollY,
            left: rect.left
        }
    };

    export default {
        name: "rf-map",
        components: {InfoBox},
        props: {
          regions: {type: Object, required: true}
        },
        data() {
            return {
                current: null
            }
        },
        computed: {
            style() {
                const res = {};
                Object.keys(this.regions).forEach(rg => {
                    if(!this.regions[rg].color) return;
                    res[rg] = {fill: valueToHSL(this.regions[rg].color)};
                });
                return res;
            }
        },
        methods: {
            _in(e) {
                if(e.target === this.$refs.svg) return;
                if(!e.target.id) return;
                const info = this.regions[e.target.id].info;
                if(info.length === 0) return;
                const rect = e.target.getBoundingClientRect();
                const offset = getOffset(this.$refs.svg);
                const top = Math.round(rect.top + (rect.bottom - rect.top) / 2) + window.scrollY;
                const left = Math.round(rect.left + (rect.right - rect.left) / 2);
                this.current = {
                    pos: {top: top - offset.top, left: left - offset.left},
                    info: info
                }
            },
            _out(e) {
                if(e.target === this.$refs.svg) return;
                this.current = null;
            }
        }
    }
</script>

